import React from 'react';
import {Link} from 'react-router-dom';
import {List} from 'antd';
import {skeletonMyGroupInSider} from './../Skeleton/index.jsx';

function YourPageInSider(props){
  const totalSkeleton = [1,2];

  if(props.loading){
    return(
      <React.Fragment>
        <div className="box-your-pages-title">Nhóm của bạn</div>
          {totalSkeleton.map(() => skeletonMyGroupInSider)}
      </React.Fragment>
    )
  }
  return(
    <React.Fragment>
      <div className="box-your-groups-title">Nhóm của bạn</div>
      {props.groups.length ? <>
      {props.groups.map((group, index) =>{
        return(
        <List.Item>
          <Link to="your_pages">
              <div className="box-your-pages-item">
                <div className="box-your-groups-item-avatar">
                  <img src="https://1.bp.blogspot.com/-4AHGUBUm8eQ/VvKliwBC_yI/AAAAAAAAAeM/sBwETdSRydcae3rqEiIRIEAOd10CITzsA/s1600/hinh-girl-xinh-gai-dep-han-quoc-03.jpg" alt="" />
                </div>
                <div className="box-your-pages-item-info">
                  <span>nguyễn Văn Phước nguyễn Văn Phước nguyễn Văn Phước nguyễn Văn Phước nguyễn Văn Phước</span>
                </div>
              </div>
          </Link>
        </List.Item>
      )
    })} </> : <div>Bạn chưa tạo trang</div>}
    </React.Fragment>
  )
}

export default YourPageInSider;
